import "./App.css";
import Nav from "./components/Nav";
import Home from "./components/Home";
import Noticias from "./components/Noticias";
import Estadisticas from "./components/Estadisticas";
import CompraVenta from "./components/CompraVenta";
import Plantilla from "./components/Plantilla";
//import Login from "./components/Login";
import Register from "./components/Register";
import { BrowserRouter as Router, Switch, Route } from "react-router-dom";
import React from "react";
import {userContext, setUserContext} from './components/user';
import axios from "axios";
import { Link } from "react-router-dom";

function App() {

  const [user, setUser] = React.useState({});

  return (
    <Router>
      <userContext.Provider value={user} >
        <setUserContext.Provider value={setUser} >
          <div className="App">
            <Nav />
            <Switch>
              <Route path="/" exact component={Home} />
              <Route path="/Login" exact component={Login} />
              <Route path="/Register" exact component={Register} />
              <Route path="/Noticias" exact component={Noticias} />
              <Route path="/Estadisticas" exact component={Estadisticas} />
              <Route path="/CompraVenta" exact component={CompraVenta} />
              <Route path="/Plantilla" exact component={Plantilla} />
            </Switch>
          </div>
        </setUserContext.Provider>
      </userContext.Provider>
    </Router>
  );
}

async function loginUser(credenciales, setUserInfo) {

  const url = "http://localhost:8000/api/Usuarios/?search=" + credenciales.usuario;
  const response = await axios.get(url);
  const data = await response.data;

  if(data[0].nombre === credenciales.usuario){ 

    if(data[0].password === credenciales.password){

      setUserInfo(data[0].nombre);

    }
    else{

      alert('Comprueba los datos introducidos');

    }
  }
  else{

    alert('Comprueba los datos introducidos');

  }
}

function Login() {

  const userInfo = React.useContext(userContext);
  const setUserInfo = React.useContext(setUserContext);

  const [usuario, setUsuario] = React.useState({});
  const [password, setPassword] = React.useState({});

  console.log(userInfo);

  const handleLogin = async (e) => {

    e.preventDefault();
    await loginUser({

      usuario,
      password,

    }, setUserInfo);

  };

  if (userInfo != null) {

    return (
      <div className="App container">
        <div className="justify-content-center row">
          <h1 style={{ color: "white" }}>Ya estas logeado</h1>
          <button
            type='button'
            className="btn btn-warning"
            onClick={setUserInfo(null)}
          >
            Logout
          </button>
        </div>
      </div>
    );

  }

  return (
    <div className="App container">
      <div className="justify-content-center row">
        <h1 style={{ color: "white" }}>Inicio de sesion</h1>
      </div>
      <Link to="/Register" className="nav-item nav-link active">
        Registro
      </Link>
      <div className="justify-content-center row">
        <form className="mt-5" onSubmit={handleLogin}>
          <label>
            <p>Username</p>
            <input required type="text" onChange={(e) => setUsuario(e.target.value)} />
          </label>
          <label>
            <p>Password</p>
            <input
              required
              type="password"
              onChange={(e) => setPassword(e.target.value)}
            />
          </label>
          <div>
            <button type='button' className="btn btn-success" type="submit">
              Iniciar Sesi√≥n
            </button>
          </div>
        </form>
      </div>
    </div>
  );
}

export default App;
